-->Oops! Due to my heavy homework load in school, I will not be able to put the April scholarship to use. Hopefully you can share my scholarship with another applicant. I will submit a slightly modified version of my essays in the summer camp application.Thanks,-Quinn From: AI CampSent: Sunday, March 28, 2021 11:29 PMTo: quinnyockey@gmail.comSubject: RE: your AI Camp Conceptual Scholarship Application Update Hello Quinn!  Thanks for reaching out. I believe you might have applied to the wrong program. This specific scholarship is for our Conceptual Series. If you were looking for our Summer Scholarship then I would be happy to direct you to that as well.  Here is the link to apply for the April Scholarship Round. I suggest filling out the following application as thorough and as passionately as possible. https://www.ai-camp.org/summer-camp-scholarship-region-2 The application will be evaluated end of April.  Let me know if this helps.  Best,  Axel Mora Community Support  AI Camp P: (626) 688-7921 E: hello@ai-camp.org  On Sun, Mar 28, 2021 at 11:00 PM, Quinn.Yockey <quinnyockey@gmail.com> wrote: Thank you so much for the scholarship! I am super excited, but when I went to sign up for a course slot this summer, I was taken to a page to sign up for a camp starting April 3rd. Are the summer camp sessions full?  From: AI CampSent: Friday, March 26, 2021 5:25 PMTo: quinnyockey@gmail.comSubject: your AI Camp Conceptual Scholarship Application Update  Hi Quinn, Thank you for taking the time to apply to AI Camp's AI Conceptual Course scholarship program . We have reviewed many submissions and after reviewing your application, we want to give you the great news that we have decided to offer you a full scholarship that covers the cost of this 3 class course. To use this scholarship, simply use the link below to select an available course opening and apply the scholarship code provided below. We recommend that you sign up as soon as you possible because often times the get filled up. If by chance there are no available spots at the moment, we apologize for the inconvenience in advance, however, please check back as we are working diligently to make more spots available in the future. Booking link: [https://www.ai-camp.org/book-ai-conceptual](https://www.ai-camp.org/book-ai-conceptual)Apply this scholarship code so that the course amount goes from $99 to $0: learn_ai_free_2021One to two nights prior the scheduled start of the course, we will send out calendar invites with the zoom links for class.Please note, the zoom links provided will be the same for all three classes.Note: If the batch does not reach an attendance threshold, we will need to reschedule you to an alternate batch or provide you a rain check coupon. And Again Congratulations, AI Camp Scholarship Committee

